,\"D.每平方公里100万终端连接\"],\"answer\":\"ACD\",\"analysis\":null,\"\":null},{\"subject\":\"5G系统中哪些是无线接入网的接口\",\"option\":[\"A.Gn\",\"B.S6a\",\"C.F1\",\"D.Xn\"],\"answer\":\"CD\",\"analysis\":null,\"\":null},{\"subject\":\"对于R15版本的5GNR，以下说法正确的是\",\"option\":[\"A.当μ=1是，SCS=30kHz，可配置普通CP，此时一个无线帧中包含280个符号；\",\"B.当μ=1是，SCS=30kHz，可配置扩展CP，此时一个无线帧中包含240个符号；\",\"C.当μ=2是，SCS=60kHz，可配置扩展CP，此时一个无线帧中包含480个符号；\",\"D.当μ=2是，SCS=60kHz，可配置普道CP，此时一个无线帧中包含560个符号；\"],\"answer\":null,\"analysis\":null,\"\":null},{\"subject\":\"5G系统中C-RAN中的C代表哪些含义\",\"option\":[\"A.Clean\",\"B.Cloud\",\"C.Centralization\",\"D.Collaborative\"],\"answer\":\"ABCD\",\"analysis\":\"C-RAN是根据现网条件和技术进步的趋势，提出的新型无线接入网构架。C-RAN是基于集中化处理(Centralized Processing)，协作式无线电(Collaborative Radio)和实时云计算构架(Real-time Cloud Infrastructure)的绿色无线接入网构架(Clean system)。其本质是通过实现减少基站机房数量，减少能耗，采用协作化、虚拟化技术，实现资源共享和动态调度，提高频谱效率，以达到低成本，高带宽和灵活度的运营。C-RAN的总目标是为解决移动互联网快速发展给运营商所带来的多方面挑战（能耗，建设和运维成本，频谱资源），追求未来可持续的业务和利润增长。\",\"\":null},{\"subject\":\"以下属于5G网络演进趋势的是\",\"option\":[\"A.NFV：网络功能软件化\",\"B.用户面下沉，降低时延\",\"C.用网络切片实现不同场景，不同“专网”，满足物联定制化\",\"D.利用SDN实现网络自动化调整\"],\"answer\":\"ABCD\",\"analysis\":null,\"\":null},{\"subject\":\"5G需求驱动力\",\"option\":[\"A.物联网\",\"B.自动驾驶\",\"C.VR\\/AR\",\"D.大视频\"],\"answer\":\"ABCD\",\"analysis\":null,\"\":null},{\"subject\":\"5GNR中，下行参考信号包括\",\"option\":[\"A.PT-RS \",\"B.CRS \",\"C.DMRS \",\"D.CSI-RS\"],\"answer\":\"ACD\",\"analysis\":null,\"\":null},{\"subject\":\"Self-contained slot有两种结构，分别是\",\"option\":[\"A.UL-dominant slot \",\"B.UL-only slot \",\"C.DL-only slot\",\"D.DL-dominant slot\"],\"answer\":\"AD\",\"analysis\":null,\"\":null},{\"subject\":\"大规模天线可以\",\"option\":[\"A.降低小区干扰\",\"B.提升网络容量\",\"C.提高系统吞吐量\",\"D.提升频谱效率\"],\"answer\":\"ABCD\",\"analysis\":null,\"\":null},{\"subject\":\"5G系统中C-RAN高速移动场景使用的频率是\",\"option\":[\"A.30GHZ频段\",\"B.70GHZ频段\",\"C.4GHZ频段\",\"D.100GHZ频段\"],\"answer\":\"C\",\"analysis\":null,\"\":null},{\"subject\":\"当前，5G上行采用的多址技术是\",\"option\":[\"A.SC-FDMA\",\"B.OFDMA \",\"C.CP-OFDMA \",\"D.FDMA\"